define(['lib/canvas'], function(canvas){

  canvas.init('#Testcanvas');

  var element = document.getElementById('Testcanvas');
  var context = element.getContext('2d');
  var fullRectArgs = [0, 0, element.width, element.height];

  test('API-Vollständigkeit', function(){
    equal(typeof canvas, 'object', 'canvas-Modul übergibt Objekt');
    equal(typeof canvas.init, 'function', 'canvas.init ist eine Funktion');
    equal(canvas.init.length, 1, 'canvas.init akzeptiert einen Parameter');
    equal(typeof canvas.reset, 'function', 'canvas.reset ist eine Funktion');
    equal(canvas.reset.length, 0, 'canvas.reset akzeptiert null Parameter');
    equal(typeof canvas.drawUrl, 'function', 'canvas.drawUrl ist eine Funktion');
    equal(canvas.drawUrl.length, 2, 'canvas.reset akzeptiert zwei Parameter');
  });

  test('reset()', function(){
    var fail = false;
    context.fillRect.apply(context, fullRectArgs);
    canvas.reset();
    var img = context.getImageData.apply(context, fullRectArgs);
    for(var i = 0; i < img.data.length; i++){
      if(img.data[i] !== 0){
        fail = true;
        break;
      }
    }
    ok(!fail, 'reset() löscht die Canvas');
  });

  asyncTest('drawUrl()', function(){
    var testUrl = 'test.png';
    var expectedResult = 'data:image/png;base64,';
    var expectedDimensions = {
      width: 128,
      height: 123
    };
    canvas.drawUrl(testUrl, function(){
      ok(true, 'Callback feuert');
      equal(element.toDataURL(), expectedResult, 'Bild wird gezeichnet');
      equal(element.width, expectedDimensions.width, 'Breite wird angepasst');
      equal(element.height, expectedDimensions.height, 'Höhe wird angepasst');
      start();
    });
  });

});